import './App.css';


function App() {
  const characters = ['Zenyatta', 'Widowmaker'];

  return (
    <div>
      <h1>Overwatch Character Selector</h1>

      {characters.map((character) => {
        <label key={character}>key</label>
      })}


    </div>
  );
}

export default App;
